import React, { useEffect, useState } from "react";
import axios from "axios"
import PostForm from "./components/PostForm"
import "./App.css";

const App = () => {
  const[posts,setPosts]=useState([])
  useEffect(()=>{
    axios.get(`http://mockrestapi.herokuapp.com/api/employee?pageNo=1&limit=5`)
    .then(res => {
      console.log(res)
    })
    .catch(err => {
      console.log(err)
    })
  })
  return (
  <div clssname="app-container">
    <table>
      <thead>
        <tr>
          <th>name</th>
          <th>email</th>
          <th>phone</th>
          <th>address</th>
          <th>country</th>
          <th>age</th>
          <th>Delete op</th>
        </tr>
      </thead>
     <tbody>
     {posts.map(post=>
      <tr>
        <td>{post.name}</td>
        <td>{post.email}</td>
        <td>{post.email}</td>
        <td>{post.email}</td>
        <td>{post.email}</td>
        <td>{post.email}</td>
        <th><button>Delete</button></th>
      </tr>
)}
     </tbody>
      </table>
      <PostForm/>
  </div>
  );
};
export  default App;
